use superbill_2795_prod
GO

alter table zzImport_20091226 add rowid int identity(1,1) primary key clustered



alter table zzImport_20091226 add PrimaryInsurance varchar(255)
alter table zzImport_20091226 add PrimaryPlan varchar(255)

alter table zzImport_20091226 add SecondaryInsurance varchar(255)
alter table zzImport_20091226 add SecondaryPlan varchar(255)

update w
SET PrimaryInsurance=ltrim(rtrim(left([Primary Insurance],  charindex( '->', [Primary Insurance])-1)))
from zzImport_20091226 w

update w
SET Primaryplan=ltrim(rtrim(right([Primary Insurance],  len( [Primary Insurance] ) - charindex( '->', [Primary Insurance])-1)))
from zzImport_20091226 w

update w
SET SecondaryInsurance=ltrim(rtrim(left([Secondary Insurance],  charindex( '->', [Secondary Insurance])-1)))
from zzImport_20091226 w

update w
SET Secondaryplan=ltrim(rtrim(right([Secondary Insurance],  len( [Secondary Insurance] ) - charindex( '->', [Secondary Insurance])-1)))
from zzImport_20091226 w

alter table zzImport_20091226 add firstname varchar(255)
alter table zzImport_20091226 add lastname varchar(255)

update w
set lastname = left([Patient Name], charindex( ',', [Patient Name])-1), 
	firstname = right([Patient Name], len([Patient Name]) - charindex( ',', [Patient Name])-1) 
from zzImport_20091226 w


