-- ===========================
-- Fix Phone Number
-- ===========================

alter table dbo.zzImport_20091226 add BusinessPhone varchar(10)
alter table dbo.zzImport_20091226 add BusinessPhoneExt varchar(10)

select distinct 
	[Business Phone],
	BusinessPhone = replace(replace(replace(replace(left([Business Phone], charindex( 'x', [Business Phone])-1), '-', ''), '(', ''), ')', ''), ' ', ''),
	BusinessPhoneExt = right([Business Phone], len([Business Phone]) - charindex( 'x', [Business Phone])) 
from zzImport_20091226 w
where charindex( 'x', [Business Phone]) > 1

update w
set BusinessPhone = replace(replace(replace(replace(left([Business Phone], charindex( 'x', [Business Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Business Phone]) > 1 )
	and 1=isnumeric( replace(replace(replace(replace(left([Business Phone], charindex( 'x', [Business Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '') ) 
	

update w
set BusinessPhone = replace(replace(replace(replace([Business Phone], '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Business Phone]) = 0   )
	and 1=isnumeric( replace(replace(replace(replace([Business Phone], '-', ''), '(', ''), ')', ''), ' ', ''))
	and len( replace(replace(replace(replace([Business Phone], '-', ''), '(', ''), ')', ''), ' ', '') ) <= 10
	and BusinessPhone is null

update w
set BusinessPhoneExt = replace(replace(replace(replace( right([Business Phone], len([Business Phone]) - charindex( 'x', [Business Phone])) , '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where 1=isnumeric( replace(replace(replace(replace( right([Business Phone], len([Business Phone]) - charindex( 'x', [Business Phone])) , '-', ''), '(', ''), ')', ''), ' ', '') ) 
	and ( charindex( 'x', [Business Phone]) > 1 )


alter table zzImport_20091226 add homePhone varchar(10)


update w
set homePhone = replace(replace(replace(replace([Home Phone], '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Home Phone]) = 0   )
	and 1=isnumeric( replace(replace(replace(replace([Home Phone], '-', ''), '(', ''), ')', ''), ' ', ''))
	and len( replace(replace(replace(replace([Home Phone], '-', ''), '(', ''), ')', ''), ' ', '') ) = 10


alter table zzImport_20091226 add MobilePhone varchar(10)


update w
set MobilePhone = replace(replace(replace(replace(left([Mobile Phone], charindex( 'x', [Mobile Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Mobile Phone]) >1   )
	and 1=isnumeric( replace(replace(replace(replace(left([Mobile Phone], charindex( 'x', [Mobile Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '') )



update w
set MobilePhone = replace(replace(replace(replace( [Mobile Phone] , '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Mobile Phone]) = 0   )
	and 1=isnumeric( replace(replace(replace(replace( [Mobile Phone] , '-', ''), '(', ''), ')', ''), ' ', '') )
	and MobilePhone is null

