--==========================================
-- Primary Insurance Plan
--==========================================

alter table zzImport_20091226 add PrimaryInsuranceMainPhone varchar(10)
alter table zzImport_20091226 add PrimaryInsuranceMainPhoneExt varchar(10)

update w
set PrimaryInsuranceMainPhone = replace(replace(replace(replace(left([Primary Insurance Main Phone], charindex( 'x', [Primary Insurance Main Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Primary Insurance Main Phone]) > 1 )
	and 1=isnumeric( replace(replace(replace(replace(left([Primary Insurance Main Phone], charindex( 'x', [Primary Insurance Main Phone])-1), '-', ''), '(', ''), ')', ''), ' ', '') ) 
	
update w
set PrimaryInsuranceMainPhone = replace(replace(replace(replace([Primary Insurance Main Phone], '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where ( charindex( 'x', [Primary Insurance Main Phone]) = 0   )
	and 1=isnumeric( replace(replace(replace(replace([Primary Insurance Main Phone], '-', ''), '(', ''), ')', ''), ' ', ''))
	and len( replace(replace(replace(replace([Primary Insurance Main Phone], '-', ''), '(', ''), ')', ''), ' ', '') ) = 10
	and PrimaryInsuranceMainPhone is null

update w
set PrimaryInsuranceMainPhoneExt = replace(replace(replace(replace( right([Primary Insurance Main Phone], len([Primary Insurance Main Phone]) - charindex( 'x', [Primary Insurance Main Phone])) , '-', ''), '(', ''), ')', ''), ' ', '')
from zzImport_20091226 w
where 1=isnumeric( replace(replace(replace(replace( right([Primary Insurance Main Phone], len([Primary Insurance Main Phone]) - charindex( 'x', [Primary Insurance Main Phone])) , '-', ''), '(', ''), ')', ''), ' ', '') ) 
	and ( charindex( 'x', [Primary Insurance Main Phone]) > 1 )


alter table zzImport_20091226 add [PrimaryInsuranceState] char(2)

alter table zzImport_20091226 add [SecondaryInsuranceState] char(2)

update z 
set [PrimaryInsuranceState]=s.state
from zzImport_20091226 z
	inner join #state s
		on s.Name=z.[Primary Insurance State]

update z 
set [SecondaryInsuranceState]=s.state
from zzImport_20091226 z
	inner join #state s
		on s.Name=z.[Secondary Insurance State]
