select * from vendorImport 



begin tran

declare @practiceID int, @vendorImportID int
select @practiceID=1, @vendorImportID=1

INSERT INTO [dbo].[Employers] (
	[EmployerName]
	,[AddressLine1]
	,[AddressLine2]
	,[City]
	,[State]
	,[Country]
	,[ZipCode]
	,[CreatedDate]
	,[CreatedUserID]
	,[ModifiedDate]
	,[ModifiedUserID]
	,VendorImportID
)
         
select distinct 
	[Employer],
	NULL,
	NULL,
	NULL,
	NULL,
	NULL,
	NULL,
	getdate(),
	951,
	getdate(),
	951,
	@vendorImportID
from zzImport_20091226
where Employer is not null
	and Employer not in (select employerName from Employers)


	INSERT INTO [dbo].[Patient](
		prefix,
		Suffix,
		MiddleName,
		[PracticeID],
		[FirstName],
		[LastName],
		[AddressLine1],
		[AddressLine2],
		[City],
		[State],
		[ZipCode],
		[HomePhone],
		WorkPhone,
		WorkPhoneExt,
		MobilePhone,
		[DOB],
		SSN,
		[Gender],
		[VendorID],
		MedicalRecordNumber,
		VendorImportID,
		CollectionCategoryID,
		DefaultServiceLocationID,
		PrimaryProviderID,
		EmailAddress,
		EmploymentStatus,
		EmployerID,
		MaritalStatus
		)
	    
	SELECT 
		'',
		'',
		'' as MI,
		@practiceID as practiceID,
		isnull( firstname, ''),
		isnull( lastname, ''),
		left([Home Address 1], 256),
		left([Home Address 2], 256),
		i.[Home City],
		left(s.State, 2),
		left([Home Zip/Postal Code], 9),
		[HomePhone],
		BusinessPhone,
		BusinessPhoneExt,
		MobilePhone, 
		[Date of Birth],
		replace(SocialSecurityNumber, '-', '') SSN,
		[Sex],  
		rowid as [VendorID], -- vendorID
		[Medical Record #] as  MRN,
		@vendorImportID, -- vendorID
		1,
		null as serviceLocationID,
		null as primaryProviderID,
		Email as Email,
		EmploymentStatus = case when e.EmployerName=i.[Employer]
			then 'E'
			else NULL 
			end ,
		e.EmployerID,
		null as MaritalStatus
	from zzImport_20091226 i
		LEFT JOIN  [Employers] e
			on e.EmployerName=i.[Employer]
		left join #state s
			on s.name=i.[Home State/Province]
	where not exists(select * from patient p where p.vendorID=i.rowID)



	-- Primary
	INSERT INTO [PatientCase]
		([PatientID]
		,[Name]
		,[Active]
		,[PayerScenarioID] -- select * from payerScenario
		,[CreatedUserID]
		,[ModifiedUserID]
		,[PracticeID]
		,VendorImportID
		,VendorID
		   )
	select
		patientID,	
		PrimaryPlan,
