insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
)
select 	pc.PatientCaseID
	,icp.InsuranceCompanyPlanID
	,1 --Precedence
	,[Primary Insurance Insured ID #]
	,[Primary Insurance Group #]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,w.rowID as VendorID
	,1 as VendorImportID
	,p.PracticeID
from zzImport_20091226 w
	inner join Patient p (nolock)
		on p.vendorID=w.rowID
	inner join PatientCase pc (nolock)
		on pc.patientID=p.patientID
		and pc.VendorID=p.VendorID
	inner join insuranceCompany ic (nolock)
		on ic.insuranceCompanyName=w.PrimaryInsurance
	inner join insuranceCompanyPlan icp (nolock)
		on icp.insuranceCompanyID=ic.insuranceCompanyID 
		and icp.PlanName=w.PrimaryPlan
where p.vendorImportID=1
	and isnull(icp.AddressLine1, '')=isnull([Primary Insurance Address 1], '')
	and isnull(icp.AddressLine2, '')=isnull([Primary Insurance Address 2], '')
	and isnull(icp.City, '')=isnull([Primary Insurance City], '')
	and isnull(icp.ZipCode, '')=isnull(left([Primary Insurance Postal Code],9), '')
	and isnull(icp.Phone, '')=isnull(PrimaryInsuranceMainPhone, '')
	and isnull(icp.PhoneExt, '')=isnull(PrimaryInsuranceMainPhoneExt, '')




